import React, { useState, useEffect } from 'react';
import { Database, Smartphone, Gamepad2, Wrench, Globe } from 'lucide-react';
import { Card } from '../../components/Card';
import { Badge } from '../../components/Badge';
import { Checkbox } from '../../components/Checkbox';
import { InfoBox } from '../../components/InfoBox';
import { Tabs } from '../../components/Tabs';
import { Input } from '../../components/Input';
import { CodeBlock } from '../../components/CodeBlock';

interface Step3Props {
  onComplete: () => void;
  appData: {
    appId: string;
    dataUrl: string;
    selectedVersion: 'saas' | 'private' | null;
  };
  onAppDataChange: (data: any) => void;
}

export const Step3DataIntegration: React.FC<Step3Props> = ({
  onComplete,
  appData,
  onAppDataChange
}) => {
  const [understood, setUnderstood] = useState(false);
  const [hasRequiredData, setHasRequiredData] = useState(false);

  useEffect(() => {
    const hasData = appData.appId.trim() !== '' && appData.dataUrl.trim() !== '';
    setHasRequiredData(hasData);

    if (understood && hasData) {
      onComplete();
    }
  }, [understood, appData, onComplete]);

  const platformTabs = [
    {
      id: 'javascript',
      label: 'JavaScript',
      icon: <Globe size={16} />,
      content: getJavaScriptCode(appData)
    },
    {
      id: 'ios',
      label: 'iOS',
      icon: <Smartphone size={16} />,
      content: getIOSCode(appData)
    },
    {
      id: 'android',
      label: 'Android',
      icon: <Smartphone size={16} />,
      content: getAndroidCode(appData)
    },
    {
      id: 'unity',
      label: 'Unity',
      icon: <Gamepad2 size={16} />,
      content: getUnityCode(appData)
    },
    {
      id: 'unreal',
      label: 'Unreal',
      icon: <Gamepad2 size={16} />,
      content: getUnrealCode(appData)
    },
    {
      id: 'api',
      label: 'RESTful API',
      icon: <Wrench size={16} />,
      content: getAPICode(appData)
    }
  ];

  const tabs = platformTabs.map(platform => ({
    id: platform.id,
    label: (
      <div style={{ display: 'flex', alignItems: 'center', gap: '8px' }}>
        {platform.icon}
        {platform.label}
      </div>
    ),
    content: platform.content
  }));

  return (
    <div>
      {/* Step Title */}
      <div style={{ marginBottom: '32px' }}>
        <div style={{ 
          display: 'flex', 
          alignItems: 'center', 
          gap: '12px',
          marginBottom: '16px' 
        }}>
          <Database size={24} color="var(--brand-primary)" />
          <h3 style={{ 
            fontSize: '24px', 
            fontWeight: '600', 
            color: 'var(--gray-900)',
            margin: 0
          }}>
            3단계: 데이터 연동
          </h3>
        </div>
        <p style={{ 
          fontSize: '16px', 
          color: 'var(--gray-600)',
          lineHeight: '1.6',
          margin: 0
        }}>
          앱에서 발생하는 데이터를 수집하기 위해 SDK를 설치하고 초기화하세요.
          플랫폼별 가이드를 참고하여 연동을 완료할 수 있습니다.
        </p>
      </div>

      {/* App Configuration */}
      <div style={{ marginBottom: '32px' }}>
        <Card>
          <h4 style={{ 
            fontSize: '18px', 
            fontWeight: '600', 
            marginBottom: '16px',
            color: 'var(--gray-900)'
          }}>
            설정 정보 입력
          </h4>

          <div style={{ 
            display: 'grid', 
            gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))', 
            gap: '16px',
            marginBottom: '16px'
          }}>
            <Input
              label="App ID"
              value={appData.appId}
              onChange={(value) => onAppDataChange({ ...appData, appId: value })}
              placeholder="your-app-id"
              required
            />
            <Input
              label="Data URL"
              value={appData.dataUrl}
              onChange={(value) => onAppDataChange({ ...appData, dataUrl: value })}
              placeholder="https://your-server-url/sync_js"
              required
              type="url"
            />
          </div>

          <InfoBox type="info" title="설정 정보 안내">
            <p style={{ margin: 0 }}>
              App ID와 Data URL은 프로젝트 생성 시 제공되는 고유 식별자입니다. 
              위 정보를 입력하면 아래 코드 예제에 자동으로 반영됩니다.
            </p>
          </InfoBox>
        </Card>
      </div>

      {/* Platform SDK Guides */}
      <div style={{ marginBottom: '32px' }}>
        <h4 style={{ 
          fontSize: '18px', 
          fontWeight: '600', 
          marginBottom: '16px',
          color: 'var(--gray-900)'
        }}>
          플랫폼별 SDK 가이드
        </h4>

        <Tabs tabs={tabs} defaultTab="javascript" />
      </div>

      {/* Additional Resources */}
      <div style={{ marginBottom: '32px' }}>
        <h4 style={{ 
          fontSize: '18px', 
          fontWeight: '600', 
          marginBottom: '16px',
          color: 'var(--gray-900)'
        }}>
          📚 추가 리소스 및 가이드
        </h4>

        <div style={{
          display: 'grid',
          gridTemplateColumns: 'repeat(auto-fit, minmax(280px, 1fr))',
          gap: '16px',
          marginBottom: '24px'
        }}>
          {/* 주요 문서 */}
          <Card>
            <h5 style={{ fontSize: '16px', fontWeight: '600', marginBottom: '12px', color: 'var(--brand-primary)' }}>
              📖 핵심 문서
            </h5>
            <div style={{ display: 'flex', flexDirection: 'column', gap: '8px', fontSize: '14px' }}>
              <a 
                href="https://docs-v2.thinkingdata.kr/?version=latest&lan=ko-KR&code=installation_menu-YfSvwiWwYiX1DtkCMoTcnbOsnsb&anchorId=" 
                target="_blank" 
                rel="noopener noreferrer"
                style={{ color: 'var(--gray-700)', textDecoration: 'none', display: 'flex', alignItems: 'center', gap: '6px' }}
              >
                📋 전체 SDK 설치 가이드
              </a>
              <a 
                href="https://docs-v2.thinkingdata.kr/?version=latest&lan=ko-KR&code=client_sdk_faq&anchorId=" 
                target="_blank" 
                rel="noopener noreferrer"
                style={{ color: 'var(--gray-700)', textDecoration: 'none', display: 'flex', alignItems: 'center', gap: '6px' }}
              >
                ❓ 클라이언트 SDK FAQ
              </a>
              <span style={{ color: 'var(--gray-600)', fontSize: '12px' }}>
                💡 고급 설정은 각 플랫폼 문서의 Advanced 섹션을 확인하세요
              </span>
            </div>
          </Card>

          {/* 데이터 정책 */}
          <Card>
            <h5 style={{ fontSize: '16px', fontWeight: '600', marginBottom: '12px', color: 'var(--brand-primary)' }}>
              🎯 데이터 정책
            </h5>
            <div style={{ display: 'flex', flexDirection: 'column', gap: '8px', fontSize: '14px' }}>
              <a 
                href="https://docs-v2.thinkingdata.kr/?version=latest&lan=ko-KR&code=set_properties&anchorId=" 
                target="_blank" 
                rel="noopener noreferrer"
                style={{ color: 'var(--gray-700)', textDecoration: 'none', display: 'flex', alignItems: 'center', gap: '6px' }}
              >
                📊 이벤트 트래킹 정책
              </a>
              <a 
                href="https://docs-v2.thinkingdata.kr/?version=latest&lan=ko-KR&code=data_format&anchorId=" 
                target="_blank" 
                rel="noopener noreferrer"
                style={{ color: 'var(--gray-700)', textDecoration: 'none', display: 'flex', alignItems: 'center', gap: '6px' }}
              >
                📝 데이터 형식 규칙 
                <span style={{ color: 'var(--danger)', fontWeight: '600', fontSize: '12px' }}>(필독!)</span>
              </a>
              <a 
                href="https://docs-v2.thinkingdata.kr/?version=latest&lan=ko-KR&code=preset_properties&anchorId=" 
                target="_blank" 
                rel="noopener noreferrer"
                style={{ color: 'var(--gray-700)', textDecoration: 'none', display: 'flex', alignItems: 'center', gap: '6px' }}
              >
                ⚙️ 프리셋 속성 목록
              </a>
            </div>
          </Card>

          {/* 유저 관리 */}
          <Card>
            <h5 style={{ fontSize: '16px', fontWeight: '600', marginBottom: '12px', color: 'var(--brand-primary)' }}>
              👥 유저 관리
            </h5>
            <div style={{ display: 'flex', flexDirection: 'column', gap: '8px', fontSize: '14px' }}>
              <a 
                href="https://docs-v2.thinkingdata.kr/?version=latest&lan=ko-KR&code=user_identify&anchorId=" 
                target="_blank" 
                rel="noopener noreferrer"
                style={{ color: 'var(--gray-700)', textDecoration: 'none', display: 'flex', alignItems: 'center', gap: '6px' }}
              >
                🔐 유저 식별 규칙
              </a>
              <span style={{ color: 'var(--gray-600)', fontSize: '12px' }}>
                로그인/로그아웃 처리 및 유저 매칭 로직
              </span>
            </div>
          </Card>
        </div>

        {/* 도움말 박스 */}
        <InfoBox type="info" title="💡 개발 팁">
          <div style={{ fontSize: '14px', lineHeight: '1.5' }}>
            <p style={{ margin: '0 0 8px 0' }}>
              <strong>단계별 접근:</strong> 먼저 1-2단계만 구현하여 기본 데이터 수집을 확인한 후, 필요에 따라 3-4단계를 추가하세요.
            </p>
            <p style={{ margin: '0' }}>
              <strong>테스트 환경:</strong> 개발 단계에서는 별도의 테스트 App ID를 생성하여 프로덕션 데이터와 분리하는 것을 권장합니다.
            </p>
          </div>
        </InfoBox>
      </div>

      {/* Completion Checkbox */}
      <div style={{ 
        padding: '20px', 
        backgroundColor: 'var(--gray-50)', 
        borderRadius: 'var(--border-radius)',
        border: '1px solid var(--gray-200)'
      }}>
        <Checkbox
          checked={understood}
          onChange={setUnderstood}
          label="데이터 연동 과정을 이해했으며 SDK 설치를 완료했습니다. 다음 단계로 진행할 준비가 되었습니다."
          disabled={!hasRequiredData}
        />
        {!hasRequiredData && (
          <p style={{ 
            fontSize: '12px', 
            color: 'var(--danger)', 
            margin: '8px 0 0 28px' 
          }}>
            App ID와 Data URL을 먼저 입력해주세요.
          </p>
        )}
      </div>
    </div>
  );
};

// Platform-specific code generators
function getJavaScriptCode(appData: any) {
  const { appId, dataUrl } = appData;
  const jsServerUrl = dataUrl ? (dataUrl.endsWith('/sync_js') ? dataUrl : `${dataUrl}/sync_js`) : 'https://YOUR_SERVER_URL/sync_js';

  return (
    <div>
      <div style={{ marginBottom: '24px' }}>
        <h5 style={{ fontSize: '16px', fontWeight: '600', marginBottom: '12px' }}>
          <Badge variant="success" size="sm" style={{ marginRight: '8px' }}>필수</Badge>
          1. SDK 설치
        </h5>
        <CodeBlock
          language="bash"
          title="NPM 설치"
          code="npm install thinkingdata-browser --save"
        />
      </div>

      <div style={{ marginBottom: '24px' }}>
        <h5 style={{ fontSize: '16px', fontWeight: '600', marginBottom: '12px' }}>
          <Badge variant="success" size="sm" style={{ marginRight: '8px' }}>필수</Badge>
          2. SDK 초기화 및 자동 이벤트 추적
        </h5>
        <CodeBlock
          language="javascript"
          title="자동 통합 방식"
          code={`import thinkingdata from "thinkingdata-browser";

// SDK 구성 객체 생성
var config = {
  appId: "${appId || 'YOUR_APP_ID'}",
  serverUrl: "${jsServerUrl}",
  batch: true, // 데이터를 먼저 로컬에 캐시한 후 일괄 전송합니다. 기본값은 false입니다.
  autoTrack: {
    pageShow: true, // 페이지 표시 이벤트를 활성화합니다. 이벤트 이름: ta_page_show
    pageHide: true, // 페이지 숨김 이벤트를 활성화합니다. 이벤트 이름: ta_page_hide
  }
};

// SDK 초기화
thinkingdata.init(config);`}
        />
      </div>

      <div style={{ marginBottom: '24px' }}>
        <h5 style={{ fontSize: '16px', fontWeight: '600', marginBottom: '12px' }}>
          <Badge variant="secondary" size="sm" style={{ marginRight: '8px' }}>선택</Badge>
          3. 계정 ID 설정
        </h5>
        <CodeBlock
          language="javascript"
          title="로그인 사용자 설정"
          code={`// 유저가 로그인할 때 계정 ID 설정
ta.login("user_account_id");`}
        />
      </div>

      <div style={{ marginBottom: '24px' }}>
        <h5 style={{ fontSize: '16px', fontWeight: '600', marginBottom: '12px' }}>
          <Badge variant="secondary" size="sm" style={{ marginRight: '8px' }}>선택</Badge>
          4. 이벤트 전송 및 유저 속성
        </h5>
        <CodeBlock
          language="javascript"
          title="커스텀 이벤트 및 속성"
          code={`// 공통 이벤트 속성 설정
var superProperties = {};
superProperties["channel"] = "web"; // String
superProperties["user_type"] = "premium"; // String
ta.setSuperProperties(superProperties);

// 이벤트 전송
ta.track("product_buy", { 
  product_name: "상품명",
  price: 29900 
});

// 유저 속성 설정
ta.userSet({ username: "사용자명" });`}
        />
      </div>

      <InfoBox type="success" title="설치 완료!">
        <p style={{ margin: 0 }}>
          위 1-2단계만 완료해도 기본적인 페이지 뷰 이벤트가 자동으로 수집됩니다. 
          3-4단계는 필요에 따라 추가로 구현하세요.
        </p>
      </InfoBox>

    </div>
  );
}

function getIOSCode(appData: any) {
  const { appId, dataUrl } = appData;
  const iosServerUrl = dataUrl || 'https://YOUR_SERVER_URL';

  return (
    <div>
      <div style={{ marginBottom: '24px' }}>
        <h5 style={{ fontSize: '16px', fontWeight: '600', marginBottom: '12px' }}>
          <Badge variant="success" size="sm" style={{ marginRight: '8px' }}>필수</Badge>
          1. SDK 설치
        </h5>
        <CodeBlock
          language="ruby"
          title="Podfile"
          code={`# iOS 8.0 이상 필요
platform :ios, '8.0'

target 'YourApp' do
  pod 'ThinkingSDK'
end`}
        />
      </div>

      <div style={{ marginBottom: '24px' }}>
        <h5 style={{ fontSize: '16px', fontWeight: '600', marginBottom: '12px' }}>
          <Badge variant="success" size="sm" style={{ marginRight: '8px' }}>필수</Badge>
          2. SDK 초기화 및 자동 이벤트 추적
        </h5>
        <CodeBlock
          language="swift"
          title="AppDelegate.swift"
          code={`import ThinkingSDK

@UIApplicationMain
class AppDelegate: UIResponder, UIApplicationDelegate {

    func application(_ application: UIApplication, didFinishLaunchingWithOptions launchOptions: [UIApplication.LaunchOptionsKey: Any]?) -> Bool {

        // SDK 초기화
        let config = TDConfig.init()
        config.appId = "${appId || 'YOUR_APP_ID'}"
        config.serverUrl = "${iosServerUrl}"
        config.autoTrackEventType = [.appStart, .appEnd, .appViewScreen] // 자동 이벤트 추적 활성화

        ThinkingAnalyticsSDK.start(with: config)

        return true
    }
}`}
        />
      </div>

      <div style={{ marginBottom: '24px' }}>
        <h5 style={{ fontSize: '16px', fontWeight: '600', marginBottom: '12px' }}>
          <Badge variant="secondary" size="sm" style={{ marginRight: '8px' }}>선택</Badge>
          3. 계정 ID 설정
        </h5>
        <CodeBlock
          language="swift"
          title="로그인 사용자 설정"
          code={`// 유저가 로그인할 때 계정 ID 설정
ThinkingAnalyticsSDK.sharedInstance().login("user_account_id")`}
        />
      </div>

      <div style={{ marginBottom: '24px' }}>
        <h5 style={{ fontSize: '16px', fontWeight: '600', marginBottom: '12px' }}>
          <Badge variant="secondary" size="sm" style={{ marginRight: '8px' }}>선택</Badge>
          4. 이벤트 전송 및 유저 속성
        </h5>
        <CodeBlock
          language="swift"
          title="커스텀 이벤트 및 속성"
          code={`// 공통 이벤트 속성 설정
var superProperties: [String: Any] = [:]
superProperties["channel"] = "iOS"
superProperties["user_type"] = "premium"
ThinkingAnalyticsSDK.sharedInstance().setSuperProperties(superProperties)

// 이벤트 전송
ThinkingAnalyticsSDK.sharedInstance().track("product_buy", properties: [
    "product_name": "상품명",
    "price": 29900
])

// 유저 속성 설정
ThinkingAnalyticsSDK.sharedInstance().userSet([
    "username": "사용자명",
    "age": 25
])`}
        />
      </div>

      <InfoBox type="success" title="설치 완료!">
        <p style={{ margin: 0 }}>
          위 1-2단계만 완료해도 기본적인 앱 시작/종료, 화면 전환 이벤트가 자동으로 수집됩니다. 
          3-4단계는 필요에 따라 추가로 구현하세요.
        </p>
      </InfoBox>
    </div>
  );
}

function getAndroidCode(appData: any) {
  const { appId, dataUrl } = appData;
  const androidServerUrl = dataUrl || 'https://YOUR_SERVER_URL';

  return (
    <div>
      <div style={{ marginBottom: '24px' }}>
        <h5 style={{ fontSize: '16px', fontWeight: '600', marginBottom: '12px' }}>
          <Badge variant="success" size="sm" style={{ marginRight: '8px' }}>필수</Badge>
          1. SDK 설치
        </h5>
        <CodeBlock
          language="gradle"
          title="app/build.gradle"
          code={`dependencies {
    implementation 'cn.thinkingdata.android:ThinkingAnalyticsSDK:2.8.+'
}`}
        />
      </div>

      <div style={{ marginBottom: '24px' }}>
        <h5 style={{ fontSize: '16px', fontWeight: '600', marginBottom: '12px' }}>
          <Badge variant="success" size="sm" style={{ marginRight: '8px' }}>필수</Badge>
          2. SDK 초기화 및 자동 이벤트 추적
        </h5>
        <CodeBlock
          language="java"
          title="MainApplication.java"
          code={`import cn.thinkingdata.analytics.ThinkingAnalyticsSDK;
import cn.thinkingdata.analytics.TDConfig;

public class MainApplication extends Application {
    @Override
    public void onCreate() {
        super.onCreate();

        TDConfig config = TDConfig.getInstance(this, "${appId || 'YOUR_APP_ID'}", "${androidServerUrl}");
        // 자동 이벤트 추적 활성화
        config.setAutoTrackEventType(TDConfig.TDAutoTrackEventType.ALL);

        ThinkingAnalyticsSDK.sharedInstance(config);
    }
}`}
        />
      </div>

      <div style={{ marginBottom: '24px' }}>
        <h5 style={{ fontSize: '16px', fontWeight: '600', marginBottom: '12px' }}>
          <Badge variant="secondary" size="sm" style={{ marginRight: '8px' }}>선택</Badge>
          3. 계정 ID 설정
        </h5>
        <CodeBlock
          language="java"
          title="로그인 사용자 설정"
          code={`// 유저가 로그인할 때 계정 ID 설정
ThinkingAnalyticsSDK.sharedInstance().login("user_account_id");`}
        />
      </div>

      <div style={{ marginBottom: '24px' }}>
        <h5 style={{ fontSize: '16px', fontWeight: '600', marginBottom: '12px' }}>
          <Badge variant="secondary" size="sm" style={{ marginRight: '8px' }}>선택</Badge>
          4. 이벤트 전송 및 유저 속성
        </h5>
        <CodeBlock
